// src/pages/HomePage.js
import React from 'react';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to Event Planning App</h1>
      <p>Browse and create amazing events!</p>
      <div>
        <h2>Upcoming Events</h2>
        <p>Event listings will appear here...</p>
      </div>
    </div>
  );
};

export default HomePage;
